import React, { Component } from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  height: 100%;
  width: 100%;
  align-items: center;
  justify-content: center;
  background-color: #262626;
  color: white;
`;

function Home({ ws }) {
  return <Container>Welcome home</Container>;
}

export default Home;
